import React from 'react';
import './../assets/about.scss';
import {Parallax , ParallaxProvider} from 'react-scroll-parallax';
import mountain0 from '../assets/img/mountains/0.png'
import mountain1 from '../assets/img/mountains/1.png'
import mountain2 from '../assets/img/mountains/2.png'
import mountain3 from '../assets/img/mountains/3.png'
import mountain4 from '../assets/img/mountains/4.jpg'

export default class About extends React.Component{
    render(){
        return (
            <div>
                <div className="container">
                <ParallaxProvider>
                    <Parallax y={[-60, 0]}>
                        <img src={mountain4}/>
                    </Parallax>
                    <Parallax y={[-100, -100]}>
                        <img src={mountain0}/>
                    </Parallax>
                    <Parallax y={[-120, -300]}>
                        <img src={mountain1}/>
                    </Parallax>
                    {/* <Parallax y={[-20, 20]}>
                        <img src={mountain2}/>
                    </Parallax> */}
                    {/* <Parallax y={[-20, 20]}>
                        <img src={mountain1}/>
                    </Parallax> */}
                </ParallaxProvider>
                </div>
            </div>
        )
    }
}
